export const qnadummy = [
  {
    "name": "Document A",
    "qna": [
      {
        "question": "What is A's favorite color?",
        "answer": "Blue"
      },
      {
        "question": "What is A's second favorite color?",
        "answer": "Purple"
      }
    ]
  },
  {
    "name": "Document B",
    "qna": [
      {
        "question": "What is B's favorite color?",
        "answer": "Yellow"
      },
      {
        "question": "What is B's second favorite color?",
        "answer": "Green"
      }
    ]
  }
];
